import 'react-native-gesture-handler';
import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { StyleSheet, View } from 'react-native';
import { Provider } from 'react-redux';
import configureStore from './src/redux/configureStore';
import reportWebVitals from './reportWebVitals';
import CharacterDetail from './src/components/CharacterDetail/CharacterDetail';
import absalomIcon from './src/images/absalom-icon.png';

const store = configureStore({
  charactersReducer: { characterItem: {}, characterArray: [] },
  usersReducer: { userItem: {}, userArray: [] },
});

const Tab = createBottomTabNavigator();

const styles = StyleSheet.create({
  container: {
    width: '100%',
    flex: 1,
    backgroundColor: '#fff',
    justifyContent: 'center',
  },
  tabBarStyle: {
    display: 'flex',
    justifyContent: 'space-around',
    alignItems: 'center',
    height: 60,
    backgroundColor: '#091a25',
  },
});

const statusBarStyle = {
  lightContent: 'light-content',
};

export default function App() {
  return (
    <Provider store={store}>
      <NavigationContainer>
        <View style={styles.container}>
          <Tab.Navigator
            screenOptions={({ route }) => ({
              tabBarIcon: ({ focused, color, size }) => {
                let iconName;

                if (route.name === 'Character Detail') {
                  iconName = focused ? 'absalomIcon' : 'absalomIcon';
                }
              },
            })}
            tabBarOptions={{
              showIcon: true,
              style: {
                height: 60,
                backgroundColor: '#091a25',
              },
            }}
          >
            <Tab.Screen
              name="Character Detail"
              component={CharacterDetail}
            />
          </Tab.Navigator>
          <StatusBar style={statusBarStyle.lightContent} />
        </View>
      </NavigationContainer>
    </Provider>

  );
}

reportWebVitals();
